import './Form.css'
import { useState } from 'react'

const Form = () => {
  const [weather, setWeather] = useState({})


   const  submithandlet = (e) => {
    e.preventDefault();
    fetch('https://api.openweathermap.org/data/2.5/weather?q=bishkek&appid=9a076a90df603057583eee4e8ca6826b')
    .then((res) => res.json())
    .then((d) => setWeather(d))
   }


  return (
   <form className='Form-todo' onSubmit={submithandlet}>
    <input className='input-todo' type="text" placeholder='search...' />
    {JSON.stringify(weather) }
   <span>Город{weather.name}</span> 
   </form>
  )
}

export default Form
